import React from "react";
import "./RoomNumber.scss";
import { useSelector } from "react-redux";
function RoomNumber() {
  const { room } = useSelector(state => state.contactReducer);

  return <div className="RoomNumber">{`Room# ${room}`}</div>;
}

export default RoomNumber;
